import './App.css';
import freeCodeCampLogo from "./imagenes/freecodecamp-logo.png"


function App() {
  return (
    <div className="App">
       <div className='freecodecamp-logo-contenedor'>
      <img
        src={freeCodeCampLogo}
        className="freecodecamp-logo"
        alt="logo de freeCodeCamp"

      />
    </div>
    </div>
  );
}

export default App;
